pragma solidity >0.4.99 <0.6.0;

contract KittyContract {

struct Kitty { //struct de un Kitty
    bool isGestating;
    bool isReady;
    uint256 cooldownIndex;
    uint256 cooldownEndBlock;
    uint256 nextActionAt;
    uint256 siringWithId;
    uint256 birthTime;
    uint256 matronId;
    uint256 sireId;
    uint256 generation;
    uint256 genes;
    } //Autom치ticamente se genera la 'function Kitty(isGestarting) external view returns struct' por ser public.

Kitty[] public kitties; //Array din치mico de N struct Kitty
    //Autom치ticamente se genera la 'function kitties() external view returns Kitty[]' por ser public.
        //pero Al ser un array de structs nos dar치 problemas si externamente queremos que nos devuelva el Array o un Struct.

  function getKitty(uint256 _id) external view returns (
    bool isGestating,
    bool isReady,
    uint256 cooldownIndex,
    uint256 nextActionAt,
    uint256 siringWithId,
    uint256 birthTime,
    uint256 matronId,
    uint256 sireId,
    uint256 generation,
    uint256 genes
  ) {
    Kitty storage kit = kitties[_id];

    // si esta variable es 0 entonces no se esta gestando
    isGestating = (kit.siringWithId != 0);
    isReady = (kit.cooldownEndBlock <= block.number);
    cooldownIndex = uint256(kit.cooldownIndex);
    nextActionAt = uint256(kit.cooldownEndBlock);
    siringWithId = uint256(kit.siringWithId);
    birthTime = uint256(kit.birthTime);
    matronId = uint256(kit.matronId);
    sireId = uint256(kit.sireId);
    generation = uint256(kit.generation);
    genes = kit.genes;
  }
}
